import { fetchEndpoint } from "@/utils/request";
export default {
  // 获取验证码
  getCode: (data) => fetchEndpoint({
    url: "/auth/code",
    data,
    method: "delete",
    // contentType: 'json',
    isHasToken: false,
  }),
}
